(2, 'San Fabian Town Fiesta (Feast of St. Fabian)', '&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;The feast of the patron of the Parish of St. Fabian, Pope and Martyr, was celebrated with a solemn procession followed by a mass. The annual procession in honor of St. Fabian was participated in by the different barangay chapels as the people carried their own barangay patron saint. The procession was held at 7:00 in the morning. <br>\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;The parish as all the parishes in the Archdiocese usually celebrates the sacrament of confirmation during the fiestas. when the bishops visits the parish. This has been a tradition which dates back to the time when the Nueva Segovia covers the whole of Northern Luzon from the whole of Cagayan Valley and the Ilocos provinces, the Montanosa region and as far down as Zambales. At that time, the bishop of Nueva Segovia could only visit the parishes at least once a year. This was usually done during fiesta of the patron saint.\r\n<br>\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;The town fiesta celebrates with different activities and competition.', 'San Fabian Town Plaza', 'Start from 11th day of January until 27th day', );

